import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Welkom bij De Website Meesters</h1>
      <p className="text-lg">
        Wij zijn gespecialiseerd in het maken van professionele websites op maat.
      </p>
    </div>
  );
};

export default Home;
